import user from '../data/user.json'
import {Profile} from './Profile/Profile'

export const App = () => {
  return (
    <div>
       <Profile
        username ={user[0].username} 
        usertag={Profile[0].tag} 
        location={Profile[0].location} 
        avatar ={Profile[0].avatar} 
        stats={Profile[0].stats.followers} 
        
        />
      
    </div>
  );
};
